import { Stack, TextField } from "@mui/material";
import { useState } from "react";

export function Login() {

    const [isUsernameEmpty, setIsUsernameEmpty] = useState(true)
    const [isPasswordEmpty, setIsPasswordEmpty] = useState(true)

    return (
        <Stack direction='column' alignItems='center' width='100%' spacing={2} component='form' paddingTop={14}>
            <TextField id='username' label='Username' variant={isUsernameEmpty ? 'filled' : 'outlined'} onChange={(data) => setIsUsernameEmpty(data.currentTarget.value.length === 0)} />
            <TextField id='username' label='Password' variant={isPasswordEmpty ? 'filled' : 'outlined'} onChange={(data) => setIsPasswordEmpty(data.currentTarget.value.length === 0)}/>
        </Stack>
    )
}
